import React, { useState } from "react";
import "./AdminDashboard.css";

const AdminDashboard = ({ onAddBook }) => {
  const [students, setStudents] = useState([
    { id: 1, name: "John Doe", email: "john@student.com" },
    { id: 2, name: "Jane Smith", email: "jane@student.com" },
  ]);

  const [newStudent, setNewStudent] = useState({ name: "", email: "", password: "" });
  const [newBook, setNewBook] = useState({ title: "", image: "" });

  const handleAddStudent = () => {
    if (!newStudent.name || !newStudent.email || !newStudent.password) {
      alert("Please fill all the fields.");
      return;
    }

    const studentToAdd = {
      id: Math.floor(Math.random() * 10000),
      ...newStudent,
    };

    setStudents((prevStudents) => [...prevStudents, studentToAdd]);
    setNewStudent({ name: "", email: "", password: "" });
  };

  const handleDeleteStudent = (id) => {
    setStudents(students.filter((student) => student.id !== id));
  };

  const handleAddBook = () => {
    if (!newBook.title || !newBook.image) {
      alert("Please provide both title and image URL for the book.");
      return;
    }

    onAddBook(newBook); // Pass the new book to the parent component (Home.jsx)
    setNewBook({ title: "", image: "" });
  };

  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>

      {/* Students Section */}
      <div className="students-section">
        <h2>Students</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {students.map((student) => (
              <tr key={student.id}>
                <td>{student.id}</td>
                <td>{student.name}</td>
                <td>{student.email}</td>
                <td>
                  <button onClick={() => handleDeleteStudent(student.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        <div className="add-student-form">
          <h3>Add New Student</h3>
          <input
            type="text"
            placeholder="Name"
            value={newStudent.name}
            onChange={(e) => setNewStudent({ ...newStudent, name: e.target.value })}
          />
          <input
            type="email"
            placeholder="Email"
            value={newStudent.email}
            onChange={(e) => setNewStudent({ ...newStudent, email: e.target.value })}
          />
          <input
            type="password"
            placeholder="Password"
            value={newStudent.password}
            onChange={(e) => setNewStudent({ ...newStudent, password: e.target.value })}
          />
          <button onClick={handleAddStudent}>Add Student</button>
        </div>
      </div>

      {/* Add Books Section */}
      <div className="books-section">
        <h2>Add Recommended Book</h2>
        <input
          type="text"
          placeholder="Book Title"
          value={newBook.title}
          onChange={(e) => setNewBook({ ...newBook, title: e.target.value })}
        />
        <input
          type="text"
          placeholder="Image URL"
          value={newBook.image}
          onChange={(e) => setNewBook({ ...newBook, image: e.target.value })}
        />
        <button onClick={handleAddBook}>Add Book</button>
      </div>
    </div>
  );
};

export default AdminDashboard;
